import React from 'react'
import Particles from 'react-particles-js'

import Header from './components/header/header'
import Body from './components/body/body'


function App() {
  return (
    <div className="website">
        <Particles id="particles-js" 
            params={{
                particles: {
                    number: {
                        value: 400,
                        density: {
                            enable: true,
                            value_area: 1000
                        }
                    },
                    color: {
                        value: '#fff'
                    },
                    opacity: {
                        value: 1,
                        anim: {
                            enable: true
                        }
                    },
                    size: {
                        value: 7,
                        random: true,
                        anim: {
                            anim: true,
                            speed: 3
                        }
                    },
                    linke_linked: {
                        enable: true
                    },
                    move: {
                        speed: .2
                    }
                }
            }}
            />
    </div>

  );
}

export default App;
